import React, {useState, useEffect} from 'react';
import { COVER } from '../components/COVER/Cover';
import './Home.css';
import ImageSlider from '../components/imageSlider/ImageSlider';
import coverVideo from "../media/coverVideo.mp4";

export const Home = () => {

  const[scrollHeight, setScrollHeight] = useState(0);

  const handleScroll = () => {
    const position = window.pageXOffset;
    setScrollHeight = (position); 
  };

  useEffect (() => {
    window.addEventListener("scroll", handleScroll);
  }, [scrollHeight])

  const slides = [
    { url: "data:image/jpeg;base64,", title: "beach" },
    { url: "data:image/jpeg;base64,", title: "boat" },
    { url: "data:image/jpeg;base64,", title: "forest" },
    { url: "data:image/jpeg;base64,", title: "city" },
    { url: "data:image/jpeg;base64,", title: "italy" },
  ];
  const containerStyles = {
    width: "45%",
    height: "500px",
    margin: "50px",
  };


  return (
    <div className="Home">
      <COVER/>
      <div className="main-div">
        <div className="aboutus-div">
          <h2 className="aboutustitle">About us</h2>
          <p className="aboutusp">En diseño gráfico, también se llama así a los textos sin sentido (como Lorem ipsum) que se ponen para ver cómo queda un texto cuyo contenido de momento no interesa. Los programas antes mencionados también suelen tener la capacidad de generar textos aleatorios para ayudar a componer trabajos.hafhfha hfahfhahfhfahhfhafhaf</p>
        </div>
        <div className="imgslider-div" style={containerStyles}>
          <ImageSlider slides={slides} />
        </div>
      </div>
    </div>  
  );
  

};

export default Home;